import { createSelector } from "reselect";

const selectApod = state => state.apod;

export const selectApodData = createSelector(
  [selectApod],
  apod => apod.apodData
);

export const selectIsApodFetching = createSelector(
  [selectApodData],
  apod => apod.isFetching
)
